import React, { useState } from "react";
import Input from "../Input";
import Button from "../Button";
import { CardLogin, Container, ParStyled } from "./style";




export default function Login(){
  const [ user, setUser ] = useState({
    userName: '',
    password: '',
  })
  console.log(user)
  return(
    <Container>


      <CardLogin>
      <h1>Cadastro</h1>
      <label>
        Nome de usuário
      <Input
      type={'text'}
      name={'username'}
      value={user.userName}
      onChange={(e)=> setUser({userName: e.target.value, password:user.password})}
      />
      </label>
      <label>
        Senha
      <Input
      type={'password'}
      name={'password'}
      value={user.password}
      onChange={(e)=> setUser({userName: user.userName, password: e.target.value})}
      />
      </label>
      <label>
       Confirmar Senha
      <Input/>
      </label>
      <Button>Cadastrar</Button>
      <ParStyled>Cadastre agora e ganhe um bônus de R$1.000,00 para transferir entre os usuários da plataforma</ParStyled>
      </CardLogin>

    </Container>
  )
}
